import React from "react";
import { useOnClickOutside } from "react-cool-onclickoutside";

export const ResultStatistics = ({ gameStats, setShowResults, resetGame }) => {
  const ref = useOnClickOutside(() => {
    setShowResults(false);
    resetGame();
  });

  return (
    <>
      <div className="resultStats absolute z-10 ">
        {gameStats.guessResult}
        <div
          ref={ref}
          className="w-4/5 h-4/5 flex items-center justify-center rounded-lg bg-gray-800 z-40 absolute"
        >
          <p>butthole</p>
        </div>
      </div>
      <button
        className="newGameButton absolute z-20 bg-gray-800"
        onClick={() => {
          setShowResults(false);
          resetGame();
        }}
      >
        close
      </button>
    </>
  );
};
export default ResultStatistics;
